import React from 'react';
import {
  Box,
  Card,
  Typography,
  Rating,
  Slider,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Grid,
  Chip,
  IconButton,
  Tooltip,
} from '@mui/material';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineDot,
} from '@mui/lab';
import {
  AccessTime as TimeIcon,
  AddCircle as AddIcon,
  RemoveCircle as RemoveIcon,
  TrendingUp as TrendingUpIcon,
  TrendingDown as TrendingDownIcon,
  TrendingFlat as TrendingFlatIcon,
} from '@mui/icons-material';

const SymptomTracker = ({ symptoms, onSymptomUpdate }) => {
  const severityLevels = [
    { value: 1, label: 'Mild', color: '#10b981' },
    { value: 2, label: 'Moderate', color: '#f59e0b' },
    { value: 3, label: 'Severe', color: '#ef4444' },
  ];

  const frequencyOptions = [
    { value: 'rare', label: 'Rarely (Once a week or less)' },
    { value: 'occasional', label: 'Occasionally (Few times a week)' },
    { value: 'frequent', label: 'Frequently (Daily)' },
    { value: 'constant', label: 'Constantly (Throughout the day)' },
  ];

  const getTrendIcon = (trend) => {
    switch (trend) {
      case 'improving':
        return <TrendingUpIcon sx={{ color: '#10b981' }} />;
      case 'worsening':
        return <TrendingDownIcon sx={{ color: '#ef4444' }} />;
      default:
        return <TrendingFlatIcon sx={{ color: '#f59e0b' }} />;
    }
  };

  const handleSeverityChange = (symptomId, newValue) => {
    onSymptomUpdate(symptomId, { severity: newValue });
  };

  const handleFrequencyChange = (symptomId, event) => {
    onSymptomUpdate(symptomId, { frequency: event.target.value });
  };

  return (
    <Box sx={{ mt: 3 }}>
      <Typography variant="h5" gutterBottom sx={{ mb: 3 }}>
        Symptom Tracking
      </Typography>

      <Grid container spacing={3}>
        {symptoms.map((symptom, index) => (
          <Grid item xs={12} md={6} key={index}>
            <Card sx={{ p: 3 }}>
              <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                <Typography variant="h6">{symptom.name}</Typography>
                <Chip
                  label={symptom.duration || 'New'}
                  color={symptom.duration ? 'primary' : 'default'}
                  size="small"
                />
              </Box>

              <Box sx={{ mb: 3 }}>
                <Typography variant="subtitle2" gutterBottom>
                  Severity
                </Typography>
                <Rating
                  name={`severity-${index}`}
                  value={symptom.severity || 0}
                  max={3}
                  onChange={(event, newValue) => handleSeverityChange(index, newValue)}
                  icon={<CircleIcon fontSize="inherit" />}
                  emptyIcon={<CircleOutlinedIcon fontSize="inherit" />}
                  sx={{
                    '& .MuiRating-iconFilled': {
                      color: (theme) => {
                        const level = severityLevels.find(l => l.value === symptom.severity);
                        return level ? level.color : theme.palette.grey[300];
                      },
                    },
                  }}
                />
              </Box>

              <Box sx={{ mb: 3 }}>
                <Typography variant="subtitle2" gutterBottom>
                  Frequency
                </Typography>
                <FormControl fullWidth size="small">
                  <Select
                    value={symptom.frequency || ''}
                    onChange={(e) => handleFrequencyChange(index, e)}
                    displayEmpty
                  >
                    <MenuItem value="">Select Frequency</MenuItem>
                    {frequencyOptions.map((option) => (
                      <MenuItem key={option.value} value={option.value}>
                        {option.label}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </Box>

              <Box sx={{ mb: 2 }}>
                <Typography variant="subtitle2" gutterBottom>
                  Trend
                </Typography>
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  {getTrendIcon(symptom.trend)}
                  <Typography variant="body2" sx={{ ml: 1 }}>
                    {symptom.trend === 'improving' ? 'Improving' :
                     symptom.trend === 'worsening' ? 'Worsening' :
                     'Stable'}
                  </Typography>
                </Box>
              </Box>

              <Timeline position="right" sx={{ mb: 0, p: 0 }}>
                <TimelineItem>
                  <TimelineSeparator>
                    <TimelineDot color="primary">
                      <TimeIcon />
                    </TimelineDot>
                    <TimelineConnector />
                  </TimelineSeparator>
                  <TimelineContent>
                    <Typography variant="body2">
                      First noticed: {symptom.startDate || 'Today'}
                    </Typography>
                  </TimelineContent>
                </TimelineItem>
              </Timeline>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default SymptomTracker;
